import React from 'react';
import { dummyPost } from '../dummy.js';
import styled from 'styled-components';

export const Postform = styled.div`
display: flex;
width: 300px;
height: 220px;
background-color: yellow;
`
export const Postforms = styled.div`
display: flex;
width: 300px;
height: 30px;
background-color: skyblue;
`
export const Postcontent = styled.div`
flex: 2 1 100%;
white-space: nowrap;
overflow:hidden;
border: 1px solid black;
text-overflow: ellipsis;
`
export const Postimg = styled.img`
flex: 1 1 100%;

`
export const Posttitle = styled.div`
flex: 1 2 100%;
border: 1px solid black;
`
export const Postlikes = styled.div`
flex: 1 3 100%;
border: 1px solid black;
text-align: right;
`
export default function Boardpostform(){
    return(
        <center>
            <Postform>
            <Postimg className='item-img' src={dummyPost[0].image} alt={dummyPost[0].title} />
            </Postform>
            <Postforms>
            <Posttitle className='item-name' >{dummyPost[0].title}</Posttitle>
            <br /><br />
            <Postcontent>{dummyPost[0].contents}</Postcontent>
            <Postlikes className='item-price' >{dummyPost[0].total_likes}</Postlikes>
            </Postforms>
        </center>
    )
}
